import './Prix.css';
import Media from 'react-media';

// Return Prix Comptes
export default function ReturnPrix() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 )
};


export const ScreenLarge = () => (
 <div className='wrp-prix-compte'>
  <h2><span className='size-unite-prix'>30</span><span className='size-unite'>$</span></h2>
  <h2><span className='size-unite-prix'>45</span><span className='size-unite'>fc</span></h2>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-prix-compte-sm'>



 </div>
);


export const ViewText = () => (
 <>

  <h2><span className='size-unite-prix-sm'>30</span><span className='size-unite-sm'>$</span></h2>
  <h2><span className='size-unite-prix-sm'>45</span><span className='size-unite-sm'>fc</span></h2>
 </>
)
